import React from 'react'
import { useProducts } from '../context/context'
import { CarShopCard } from './PagesComponents/CarShopCard'

export const Carrito = () => {
  const { getProducts, products } = useProducts()
  useEffect(()=>{
    getProducts();
  }, [])
  return (
    <div className="bg-white">
        <div className="mx-auto max-w-2xl px-4 py-16 sm:px-6 sm:py-24 lg:max-w-7xl lg:px-8">
          <div className='flex justify-between'>
            <h2 className="text-2xl font-bold tracking-tight text-gray-900">Productos disponibles ({products.length})</h2>
            <button onClick={() => setOpen(true)} className="bg-slate-400 hover:bg-slate-500 px-3 py-2 text-white rounded-sm mx-2">Open Shop</button>
          </div>
          <div className="mt-6 grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8">
            {products.map((product) => (<CarShopCard product={product} key={product._id}></CarShopCard>))}
          </div>
        </div>
    </div>
  )
}
